<template>
  <input type="file" @change="changeHandle" accept=".pdf" />
  <vue-office-pdf
    :src="pdf"
    @rendered="renderedHandler"
    @error="errorHandler"
  />
</template>

<script>
//引入VueOfficePdf组件
import VueOfficePdf from "@vue-office/pdf";

import { ref } from "vue";

export default {
  components: {
    VueOfficePdf,
  },
  setup() {
    const pdf = ref(
      `data:application/pdf;base64,`
    ); //文档地址
    const renderedHandler = () => {
      console.log("渲染完成");
      console.log(pdf.value);
    };
    const errorHandler = () => {
      console.log("渲染失败");
    };
    const changeHandle = (e) => {
      const file = e.target.files[0];
      const reader = new FileReader();
      reader.readAsDataURL(file);
      reader.onload = (e) => {
        pdf.value = e.target.result;
      };
    };
    return {
      pdf,
      renderedHandler,
      errorHandler,
      changeHandle,
    };
  },
};
</script>
